import React from "react";
import { Link } from 'react-router-dom';


function Dropdown() {
  return (
    <>
        <div class="col-12 dropdown-main">
            <Link path="/"><div class="drop-down p-2">HOME</div></Link>
            <Link path="/About"><div class="select-option drop-down p-2" data-name="about">ABOUT</div></Link>
            <Link path="/Projects"><div class="select-option drop-down p-2" data-name="work">WORK</div></Link>
            <Link path="/"><div class="select-option drop-down p-2" data-name="contact">CONTACT</div></Link>
        </div>
    </>    
  );
}

export default Dropdown;
